// Smartphone Skills

function SkillScale(scaleValue, skillType) {

   // const {scaleValue, skillType} = props;

    const skills = ['batteryHours', 'cameraPixels', 'dualSim'];

    const scaleType = skillType === 'batteryHours' ? 'test' : 'burp';
    console.log(scaleType)

    return (
        <> 
            {skills.map((skill) =>
                scaleValue = skill.batteryHours ? <span key={skill.batteryHours}>{skillType}</span> : 'coucou'
            )} 
        </>

        );

}

export default SkillScale
